import React from 'react'
import { View, Text, StyleSheet, TextInput, Platform, TouchableOpacity  } from 'react-native'

export function Home() {
  return(
    
    <View style={styles.container}>
      <Text style={styles.title}>Bem Vindo, Nathan Gon√ßalves</Text>

      <TextInput
        style={styles.input}
        placeholder= 'New Skill'
        placeholderTextColor='#555'
        />
        <TouchableOpacity 
        style={styles.button}
        activeOpacity
        >
            <Text style={styles.buttonText}>Add</Text>
        </TouchableOpacity>
    </View>
    
  )
}

const styles= StyleSheet.create({
    container: {
        flex:1,
        backgroundColor: '#121015',
        paddingHorizontal:30,
        paddingVertical: 70
    },
    title: {
        color:'#fff',
        fontSize:34,
        fontWeight: 'bold'
    },
    input:{
        backgroundColor:'#1f1e25',
        color: '#fff',
        fontSize: 18,
        padding: Platform.OS =='ios' ? 15 : 12,
        marginTop: 30,
        borderRadius: 7
    },
    button: {
        backgroundColor:'#a370f7',
        padding:15,
        borderRadius:7,
        alignItems:'center',
        marginTop:10
    },
    buttonText: {
        color: '#fff',
        fontSize:18,
        fontWeight:'bold'
    }

})
